import React, { Component } from "react";
import { motion, transform } from "framer-motion";
import { Link, Router } from "react-router-dom";

const anchorChange = {
  rest: {
    transition: {
      duration: 1,
    },
  },
  click: {
    display: "initial",
    gridTemplateRows: "none",
    transition: {
      duration: 1,
    },
  },
};

const lineOne = {
  rest: {
    transition: {
      duration: 1,
    },
  },
  click: {
    position: "relative",
    top: 4,
    right: 1,
    transform: "rotate(45deg)",
  },
};

const lineThree = {
  rest: {
    transition: {
      duration: 1,
    },
  },
  click: {
    transform: "rotate(-45deg)",
  },
};

class HamburgerNav extends Component {
  state = {};
  render() {
    return (
      <motion.a
        initial="rest"
        whileTap="click"
        animate="rest"
        variants="anchorChange"
        href="#"
        style={{
          color: "black",
          textDecoration: "none",
          position: "relative",
          top: 20,
          display: "grid",
          gridTemplateRows: "10px 10px",
        }}
      >
        <div style={{ height: 4, width: 28, backgroundColor: "black" }}></div>
        <div
          style={{
            height: 4,
            width: 28,
            backgroundColor: "black",
          }}
        ></div>
        <div
          style={{
            height: 4,
            width: 28,
            backgroundColor: "black",
          }}
        ></div>
      </motion.a>
    );
  }
}

export default HamburgerNav;
